import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: 'auto',
      minWidth:'30ch'
    },
  },
}));


export default function BasicTextFields(props) {


  const classes = useStyles();
  const [data, setData] = useState(
      {
        "age" : "",
        "Total_Bilirubin" :"",
        
      }
  );


  return (
    <form className={classes.root} noValidate autoComplete="off">
      <TextField id="outlined-basic" label={props.label[0]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[2]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[3]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[4]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[5]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[6]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[7]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[8]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[9]}  variant="outlined" onChange={(e) => setValue(e.target.value)}/>

    </form>

  );
}
